window.bookSummaryJSON = "<p><b>The hottest footballer in town is searching for the girl who got away. Me.</b></p> <p>We had one amazing night together, but when I woke up, I knew I needed to get back to my boring life.</p> <p>But he refuses to take no for an answer. The whole city is looking for the girl with the custom-painted Converse.</p> <p>But I've got other problems. The guy who keeps coming into my cafe, who's as grumpy as he is hot. Or the quiet guy who lurks in the corner then leaves drawings for me to find.</p> <p>I was the girl that everyone ignored, but each one of these guys are going to shove me into the spotlight. And I'm not sure if any of us are going to survive that scrutiny.</p> <p>More than I Can Bear <i>is another installment in the Ursa Shifters series with a guaranteed HEA.</i></p> <p><i>Includes bonus novella,</i> Poke the Bear.</p>"; 
